import './App.css';
import Navbar from './Navbar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="banner">
        {/* Banner content */}
      </div>
      <div className="sections">
        <div className="section" style={{ backgroundColor: '#F5C2C2' }}>
          {/* Section 1 content */}
        </div>
        <div className="section" style={{ backgroundColor: '#708C82' }}>
          {/* Section 2 content */}
        </div>
      </div>
    </div>
  );
}

export default App;
